import './create.css';

const Create = ({value})=>{
    if(value){
        return(
            <div className="create px-5">
                <input type="text" className="my-2" placeholder="Title"/>
                <textarea name="note" cols="30" rows="5" className="" placeholder="Content"></textarea>
                <button className="my-2 btn btn-outline-dark btn-sm">Save</button>
            </div>
        );
    }
    return(
        <></>
    );
}

export default Create;
